import { View, Text, ScrollView, AppRegistry } from 'react-native'
import React from 'react'
import data from '../services/clothes-model.json'
import * as RNFS from 'react-native-fs';


const  Categories=() =>   {
    
  return (
    
        <ScrollView
        horizontal>
          {readFile = () => {
    RNFS.readFile('../services/clothes-model.json')
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err.message, err.code);
      })}
    };
       </ScrollView>
      
            
           
  )
}


AppRegistry.registerComponent('Categoriesname', () => Categories);
